import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { BarChart3, Home, Users, Eye, TrendingUp, Calendar, Bell, Settings } from 'lucide-react';
import { properties } from '../data/properties';
import { formatPrice } from '../utils/formatters';

const AdminPage = () => {
  const [activeTab, setActiveTab] = useState('dashboard');

  const totalProperties = properties.length;
  const forSale = properties.filter(p => p.operation === 'venta').length;
  const forRent = properties.filter(p => p.operation === 'renta').length;
  const totalViews = properties.reduce((sum, p) => sum + p.views, 0);
  const avgPrice = properties.reduce((sum, p) => sum + p.price, 0) / properties.length;

  const stats = [
    {
      icon: Home,
      label: 'Total Propiedades',
      value: totalProperties,
      change: '+12%',
      color: 'from-blue-500 to-blue-600'
    },
    {
      icon: TrendingUp,
      label: 'En Venta',
      value: forSale,
      change: '+8%',
      color: 'from-green-500 to-green-600'
    },
    {
      icon: Calendar,
      label: 'En Renta',
      value: forRent,
      change: '+15%',
      color: 'from-purple-500 to-purple-600'
    },
    {
      icon: Eye,
      label: 'Total Vistas',
      value: totalViews.toLocaleString(),
      change: '+23%',
      color: 'from-orange-500 to-orange-600'
    }
  ];

  const recentActivities = [
    { type: 'new_property', message: 'Nueva propiedad agregada: Casa Moderna en Polanco', time: '2 horas' },
    { type: 'contact', message: 'Nueva solicitud de contacto para Penthouse Condesa', time: '4 horas' },
    { type: 'view', message: 'Departamento Ejecutivo Roma Norte alcanz贸 200 vistas', time: '6 horas' },
    { type: 'contact', message: 'Solicitud de informaci贸n para Local Comercial Zona Rosa', time: '1 d铆a' }
  ];

  const tabs = [
    { id: 'dashboard', label: 'Dashboard', icon: BarChart3 },
    { id: 'properties', label: 'Propiedades', icon: Home },
    { id: 'contacts', label: 'Contactos', icon: Users },
    { id: 'notifications', label: 'Notificaciones', icon: Bell },
    { id: 'settings', label: 'Configuraci贸n', icon: Settings }
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <motion.div
          className="mb-8"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-2">
            Panel Administrativo
          </h1>
          <p className="text-gray-600">
            Gestiona tus propiedades y monitorea el rendimiento de tu negocio
          </p>
        </motion.div>

        <div className="flex flex-col lg:flex-row gap-8">
          <motion.div
            className="lg:w-64 bg-white rounded-2xl shadow-lg p-6"
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
          >
            <nav className="space-y-2">
              {tabs.map((tab) => (
                <button
                  key={tab.id}
                  onClick={() => setActiveTab(tab.id)}
                  className={`w-full flex items-center gap-3 px-4 py-3 rounded-xl font-medium transition-colors ${
                    activeTab === tab.id
                      ? 'bg-blue-100 text-blue-700'
                      : 'text-gray-600 hover:bg-gray-100'
                  }`}
                >
                  <tab.icon className="w-5 h-5" />
                  {tab.label}
                </button>
              ))}
            </nav>
          </motion.div>

          <div className="flex-1">
            {activeTab === 'dashboard' && (
              <div className="space-y-8">
                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
                  {stats.map((stat, index) => (
                    <motion.div
                      key={stat.label}
                      className="bg-white rounded-2xl shadow-lg p-6"
                      initial={{ opacity: 0, y: 20 }}
                      animate={{ opacity: 1, y: 0 }}
                      transition={{ duration: 0.5, delay: index * 0.1 + 0.2 }}
                    >
                      <div className="flex items-center justify-between mb-4">
                        <div className={`w-12 h-12 bg-gradient-to-r ${stat.color} rounded-xl flex items-center justify-center`}>
                          <stat.icon className="w-6 h-6 text-white" />
                        </div>
                        <span className="text-green-600 text-sm font-medium">
                          {stat.change}
                        </span>
                      </div>
                      <div className="text-2xl font-bold text-gray-900 mb-1">
                        {stat.value}
                      </div>
                      <div className="text-gray-600 text-sm">
                        {stat.label}
                      </div>
                    </motion.div>
                  ))}
                </div>

                <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
                  <motion.div
                    className="bg-white rounded-2xl shadow-lg p-6"
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.6, delay: 0.4 }}
                  >
                    <h3 className="text-lg font-semibold text-gray-900 mb-4">
                      Propiedades M谩s Vistas
                    </h3>
                    <div className="space-y-4">
                      {properties
                        .sort((a, b) => b.views - a.views)
                        .slice(0, 5)
                        .map((property, index) => (
                          <div key={property.id} className="flex items-center gap-4">
                            <div className="w-12 h-12 bg-gray-100 rounded-lg flex items-center justify-center text-gray-600 font-semibold">
                              #{index + 1}
                            </div>
                            <div className="flex-1">
                              <div className="font-medium text-gray-900 truncate">
                                {property.title}
                              </div>
                              <div className="text-sm text-gray-600">
                                {property.views} vistas
                              </div>
                            </div>
                            <div className="text-sm font-medium text-blue-600">
                              {formatPrice(property.price, property.operation)}
                            </div>
                          </div>
                        ))}
                    </div>
                  </motion.div>

                  <motion.div
                    className="bg-white rounded-2xl shadow-lg p-6"
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.6, delay: 0.5 }}
                  >
                    <h3 className="text-lg font-semibold text-gray-900 mb-4">
                      Actividad Reciente
                    </h3>
                    <div className="space-y-4">
                      {recentActivities.map((activity, index) => (
                        <div key={index} className="flex items-start gap-3">
                          <div className={`w-2 h-2 rounded-full mt-2 ${
                            activity.type === 'new_property' ? 'bg-green-500' :
                            activity.type === 'contact' ? 'bg-blue-500' : 'bg-orange-500'
                          }`} />
                          <div className="flex-1">
                            <div className="text-sm text-gray-900">
                              {activity.message}
                            </div>
                            <div className="text-xs text-gray-500 mt-1">
                              Hace {activity.time}
                            </div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </motion.div>
                </div>
              </div>
            )}

            {activeTab === 'properties' && (
              <motion.div
                className="bg-white rounded-2xl shadow-lg p-6"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6 }}
              >
                <div className="flex items-center justify-between mb-6">
                  <h3 className="text-lg font-semibold text-gray-900">
                    Gesti贸n de Propiedades
                  </h3>
                  <motion.button
                    className="px-4 py-2 bg-blue-600 text-white rounded-xl font-medium hover:bg-blue-700 transition-colors"
                    whileHover={{ scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                  >
                    Agregar Propiedad
                  </motion.button>
                </div>

                <div className="overflow-x-auto">
                  <table className="w-full">
                    <thead>
                      <tr className="border-b border-gray-200">
                        <th className="text-left py-3 px-4 font-medium text-gray-900">Propiedad</th>
                        <th className="text-left py-3 px-4 font-medium text-gray-900">Tipo</th>
                        <th className="text-left py-3 px-4 font-medium text-gray-900">Precio</th>
                        <th className="text-left py-3 px-4 font-medium text-gray-900">Vistas</th>
                        <th className="text-left py-3 px-4 font-medium text-gray-900">Estado</th>
                      </tr>
                    </thead>
                    <tbody>
                      {properties.slice(0, 10).map((property) => (
                        <tr key={property.id} className="border-b border-gray-100 hover:bg-gray-50">
                          <td className="py-3 px-4">
                            <div className="font-medium text-gray-900 truncate max-w-xs">
                              {property.title}
                            </div>
                            <div className="text-sm text-gray-600">
                              {property.location}
                            </div>
                          </td>
                          <td className="py-3 px-4 capitalize text-gray-600">
                            {property.type}
                          </td>
                          <td className="py-3 px-4 font-medium text-blue-600">
                            {formatPrice(property.price, property.operation)}
                          </td>
                          <td className="py-3 px-4 text-gray-600">
                            {property.views}
                          </td>
                          <td className="py-3 px-4">
                            <span className="px-2 py-1 bg-green-100 text-green-800 rounded-full text-xs font-medium">
                              Activa
                            </span>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </motion.div>
            )}

            {activeTab !== 'dashboard' && activeTab !== 'properties' && (
              <motion.div
                className="bg-white rounded-2xl shadow-lg p-12 text-center"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6 }}
              >
                <div className="text-6xl mb-4"></div>
                <h3 className="text-2xl font-bold text-gray-900 mb-2">
                  Secci贸n en Desarrollo
                </h3>
                <p className="text-gray-600">
                  Esta funcionalidad estar谩 disponible pr贸ximamente
                </p>
              </motion.div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminPage;
